pragma solidity >=0.6.0 <0.8.12;
pragma experimental ABIEncoderV2;

import "./wallet.sol";

contract Dex is Wallet {
    using SafeMath for uint256;

    enum Side {
        BUY,
        SELL
    }

    struct Order {
        uint id;
        address trader;
        Side side;
        bytes32 ticker;
        uint amount;
        uint price;
        uint filled;
    }

    uint public nextOrderId = 0;

    mapping(bytes32 => mapping(uint => Order[])) public orderBook;

    function getOrderBook(bytes32 ticker, Side side) view public returns(Order[] memory) {
        return orderBook[ticker][uint(side)];
    }

//    getOrderBook(bytes32("LINK"), Side.BUY)

    function createLimitOrder(Side side, bytes32 ticker, uint amount, uint price) public {
        if ( side == Side.BUY){
            require(balances[msg.sender]["ETH"] >= amount.mul(price));
        }
        else if (side == Side.SELL){
            require(balances[msg.sender][ticker] >= amount);
        }
        Order[]  storage orders = orderBook[ticker][uint(side)];
        orders.push(Order(nextOrderId, msg.sender, side, ticker, amount, price, 0));

        //Bubble sort
        if(side == Side.BUY){
            for (uint i = orders.length - 1; i > 0; i--) {
                if (orders[i].price < orders[i-1].price) {
                    Order memory newOrder = orders[i];
                    orders[i] = orders[i-1];
                    orders[i-1] = newOrder;
                }
                else {
                    break;
                }
            }
        }
        else if(side == Side.SELL){
            for (uint i = orders.length - 1; i > 0; i--) {
                if (orders[i].price > orders[i-1].price) {
                    Order memory newOrder = orders[i];
                    orders[i] = orders[i-1];
                    orders[i-1] = newOrder;
                }
                else {
                    break;
                }
            }

        }

        nextOrderId++;
    }

    function createMarketOrder(Side side, bytes32 ticker, uint amount) public {
        require(balances[msg.sender][ticker] >= amount, "Insufficient balance");

        uint orderBookSide;
        if (side == Side.BUY){
            orderBookSide = 1;
        }
        else{
            orderBookSide = 0;
        }            
        Order[] storage orders = orderBook[ticker][orderBookSide];

        uint totalFilled = 0;

        for (uint256 i=orders.length-1; i>=0 && totalFilled < amount; i--) {
            
            // How much we can fill from order[i]
            uint fillable;
            if (orders[i].amount > (amount - totalFilled)) {
                fillable = amount - totalFilled;
                orders[i].amount = orders[i].amount.sub(fillable);
            }
            else {
                fillable = orders[i].amount;
                orders[i].amount = 0;
                orders[i].filled = 1;
            }

            // Update totalFilled
            totalFilled = totalFilled.add(fillable);

            /*
            // calculate total prices
            totalAmount = totalAmount.add(fillable.mul(orders[i].price));
            totalPrice = totalAmount/totalFilled;
            */

            uint eth_amount;   
            if (side == Side.BUY){

                // Verify that the market order trader has enough ETH to cover the purchase (require)
                eth_amount = fillable.mul(orders[i].price);
                require(balances[msg.sender]["ETH"] >= eth_amount, "Not enough ETH for market buy");

                // Execute the trade & shift balances between buyer/seller
                balances[msg.sender]["ETH"].sub(eth_amount);
                balances[orders[i].trader][ticker].sub(fillable);
                balances[msg.sender][ticker].add(fillable);
                balances[orders[i].trader]["ETH"].add(eth_amount);

            }
            else{

                // Execute the trade & shift balances between buyer/seller
                balances[msg.sender][ticker].sub(fillable);
                balances[orders[i].trader]["ETH"].sub(eth_amount);
                balances[msg.sender]["ETH"].add(eth_amount);
                balances[orders[i].trader][ticker].add(fillable);

            }            

        }

        //Loop through the orderbook and remove 100% filled orders
        uint len_orders = orders.length;
        uint i = len_orders - 1;
        while (i <= len_orders && orders[i].amount == 0) {
            if (orders[i].amount == 0) {
                orders.pop();
                len_orders = orders.length;
            }
        }
    }
}
